import React from 'react';

function Home() {
  return (
    <div>
      <h1>Welcome to SSE Home Decor</h1>
      <p>Your one-stop shop for stylish home solutions. Explore our range of products and transform your living space today!</p>
    </div>
  );
}

export default Home;
